deck_description:
Special summon Allvain with Instant and Ready Fusion, then go for lvl 10 synchro plays

Lava Golem is for getting rid of annoying monsters (Dragoon, DPE, Apo, F0...)

Super poly could be an option in this deck

Also, level 2 tuners than can special itself are good options (because of the castle effect and lava golem effect, you cannot normal summon every turn)

&nbsp;

&nbsp;

&nbsp;

Kaiju to use with Alpha and Luna

Foolish Burial with Orochi or Snow

&nbsp;

&nbsp;

<span>This burn deck will make your opponent surrender!</span>

<span>have fun :)</span>
